import React from "react";
import './MyPosts.module.css'
import {Post} from "./Post";

let classes = {'myPosts': 'MyPorts_myPosts__6Q9c6'}


export const MyPosts = () => {

const posts = [
    {name: 'Oldos', messagePost: 'Hi! Like my post!'},
    {name: 'Ariel', messagePost: 'Like my post!'},
    {name: 'Inga', messagePost: 'Hi! Like my!'},
    {name: 'Mara', messagePost: 'Like!'},
]


    return <div className={classes.myPosts}>
        <div>
            <textarea className={'inputTextarea'}/>
        </div>
        <div>
            <button>Add Post</button>
        </div>
        <div className={classes.item}>
            <h3>My posts</h3>
<Post/>
            {posts.map((p => {
                return <Post name={p.name} messagePost={p.messagePost}/>
            }))}
        </div>
    </div>
}
